var elGR={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Επιτρέπω","Allow in your wallet":"Αφήστε το πορτοφόλι σας","Allow {symbol} first":["Επιτρέψτε πρώτα το ",["symbol"]],"Allowance pending":"Επίδομα σε εκκρεμότητα","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Παρουσιάστηκε σφάλμα κατά την προσπάθεια εκτέλεσης αυτής της ανταλλαγής. Ίσως χρειαστεί να αυξήσετε την ανοχή ολίσθησης. Εάν αυτό δεν λειτουργεί, μπορεί να υπάρχει ασυμβατότητα με το διακριτικό που διαπραγματεύεστε. Σημείωση: τα τέλη μεταφοράς και επαναφοράς δεν είναι συμβατά με το Uniswap V3.","Approval pending":"Η έγκριση εκκρεμεί","Approve":"Έγκριση","Approve Permit2":"Approve Permit2","Approve in your wallet":"Έγκριση στο πορτοφόλι σας","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Πρώτα εγκρίνετε το ",["symbol"]],"Auto":"Αυτόματο","Auto Router":"Αυτόματος δρομολογητής","Auto Router API":"Auto Router API","Balance:":"Υπόλοιπο:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Κλείσιμο","Confirm in your wallet":"Επιβεβαίωση στο πορτοφόλι σας","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Σύνδεση πορτοφολιού","Connecting…":"Σύνδεση…","Continue":"Continue","Convert {0} to {1}":["Μετατροπή ",["0"]," σε ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Αποσυνδέστε το πορτοφόλι","Dismiss":"Απόρριψη","Enter an amount":"Εισάγετε ένα ποσό","Error fetching trade":"Σφάλμα κατά την ανάκτηση της συναλλαγής","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Λήψη της καλύτερης τιμής…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Η υψηλή ολίσθηση αυξάνει τον κίνδυνο μεταβολής των τιμών","I don't have a wallet":"Δεν έχω πορτοφόλι","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Ανεπαρκές υπόλοιπο ",["0"]],"Invalid recipient":"Μη έγκυρος παραλήπτης","Max":"Μέγιστο","Max slippage":"Μέγιστη ολίσθηση","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Λείπουν εξαρτήσεις","Network fee":"Χρέωση δικτύου","No results found.":"Δεν βρέθηκαν αποτελέσματα.","No tokens are available on this network. Please switch to another network.":"Δεν υπάρχουν διαθέσιμα διακριτικά σε αυτό το δίκτυο. Μεταβείτε σε άλλο δίκτυο.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Εισαγάγετε ένα έγκυρο ολίσθημα %","Powered by the Uniswap protocol":"Τροφοδοτείται από το πρωτόκολλο Uniswap","Price impact":"Επίπτωση στην τιμή","Price updated":"Η τιμή ενημερώθηκε","Reload":"Reload","Reload the page":"Επαναφόρτωση της σελίδας","Request rejected":"Request rejected","Review swap":"Ανταλλαγή κριτικής","Search by token name or address":"Αναζήτηση με διακριτικό όνομα ή διεύθυνση","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Κάτι πήγε στραβά","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Επιτυχία","Swap":"Ανταλλαγή","Swap failed: {0}":["Η ανταλλαγή απέτυχε: ",["0"]],"Switch network":"Εναλλαγή δικτύου","Switch network in your wallet":"Εναλλαγή δικτύου στο πορτοφόλι σας","Switching network":"Δίκτυο μεταγωγής","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Το αμετάβλητο Uniswap x * y = k δεν ικανοποιήθηκε από την ανταλλαγή. Αυτό συνήθως σημαίνει ότι μία από τις μάρκες που ανταλλάσσετε περιλαμβάνει προσαρμοσμένη συμπεριφορά κατά τη μεταφορά.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Δεν είναι δυνατή η μεταφορά της μάρκας εισαγωγής. Ενδέχεται να υπάρχει πρόβλημα με τη μάρκα εισαγωγής.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Η μάρκα αποτελέσματος δεν μπορεί να μεταφερθεί. Ενδέχεται να υπάρχει ένα ζήτημα με τη μάρκα αποτελέσματος.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Δεν είναι δυνατή η μεταφορά της μάρκας αποτελέσματος. Ενδέχεται να υπάρχει πρόβλημα με τη μάρκα αποτελέσματος. Σημείωση: οι χρεώσεις μεταφοράς και οι μάρκες rebase δεν είναι συμβατές με το Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Αυτή η συναλλαγή δεν θα πετύχει λόγω της μεταβολής των τιμών. Δοκιμάστε να αυξήσετε την ανοχή ολίσθησης. Σημείωση: οι χρεώσεις μεταφοράς και οι μάρκες rebase δεν είναι συμβατές με το Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Αυτή η συναλλαγή δεν θα πετύχει είτε λόγω της κίνησης των τιμών είτε της χρέωσης κατά τη μεταφορά. Δοκιμάστε να αυξήσετε την ανοχή ολίσθησης.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Προθεσμία συναλλαγής","Transaction rejected":"Η συναλλαγή απορρίφθηκε","Transaction submitted":"Η συναλλαγή υποβλήθηκε","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Προσπαθήστε να αυξήσετε την ανοχή ολίσθησης.<0/>ΣΗΜΕΙΩΣΗ: Η χρέωση για τη μεταφορά και τα κουπόνια επαναφοράς δεν είναι συμβατά με το Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Απρόσμενο σφάλμα. Δεν ήταν δυνατή η εκτίμηση αερίου για την ανταλλαγή.","Unexpected issue with estimating the gas. Please try again.":"Μη αναμενόμενο πρόβλημα με την εκτίμηση του αερίου. ΠΑΡΑΚΑΛΩ προσπαθησε ξανα.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Θέα στο Ethercan","Wallet disconnected":"Wallet disconnected","Warning":"Προειδοποίηση","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Η συναλλαγή σας θα επανέλθει εάν εκκρεμεί για περισσότερο από αυτό το χρονικό διάστημα.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Η συναλλαγή σας θα επανέλθει αν η τιμή αλλάξει δυσμενώς περισσότερο από αυτό το ποσοστό.","minutes":"λεπτά","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," αμοιβή"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

